import React, { Component } from "react";
import { WiThermometer } from "react-icons/wi";
import { MdDashboard } from "react-icons/md";

class Amenu extends Component {
  render() {
    return (
      <div className="col-3 amenu ">
        <h5 className="meteo-text my-5">
          <WiThermometer className="thermo-size" />
          METEOROLOG
          <hr className="hr" />
        </h5>
        <p>
          <MdDashboard className="thermo-size" />
          Dashboard
        </p>
        <p>Statistics</p>
        <p>Map</p>
        <p>calendar</p>
        <p>Setting</p>
      </div>
    );
  }
}

export default Amenu;
